(249, 'https://play.google.com/store/movies/details/Spider_Man_Homecoming?id=89CY-YpPD-k', 'Spider-Man: Homecoming - Movies on Google Play', 'A young Peter Parker/Spider-Man (Tom Holland), who made his sensational debut in Captain America: Civil War, begins to navigate his newfound identity as the web-slinging super hero in Spider-Man: Homecoming. Thrilled by his experience with the Avengers, Peter returns home, where he lives with his Aunt May (Marisa Tomei), under the watchful eye of his new mentor Tony Stark (Robert Downey, Jr.). Peter tries to fall back into his normal daily routine â distracted by thoughts of proving himself to be more tha', '', 0),
